INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "O", 0, "マホ", "内田真礼", "自警団（カォン）", 42, 101001, "マホマホ王国のプリンセス", "獣人族", 10, 155, 16, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "空想、ぬいぐるみ集め", 22);
