INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "O", 0, "ミミ", "日高里菜", "リトルリリカル", 21, 102001, "お歌もにんじんも、ウサギさんも大好き♪", "獣人族", 5, 117, 10, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "かわいいもの集め", 3);
